d3.random={normal:function(n,r){var a=arguments.length;return a<2&&(r=1),a<1&&(n=0),function(){var a,t,o;do{o=(a=2*Math.random()-1)*a+(t=2*Math.random()-1)*t}while(!o||o>1);return n+r*a*Math.sqrt(-2*Math.log(o)/o)}},logNormal:function(){var n=d3.random.normal.apply(d3,arguments);return function(){return Math.exp(n())}},irwinHall:function(n){return function(){for(var r=0,a=0;a<n;a++)r+=Math.random();return r/n}}};